import React from 'react';
import { BrowserRouter as Router, Switch, Route , Link} from 'react-router-dom';
import classScreen from './_screens/classScreen';
import homeScreen from './_screens/homeScreen';


class App extends React.Component {
  render(){
    return (
      <Router>
          <Switch>
            <Route path="/" exact component={classScreen} />
            <Route path="/register" component={homeScreen} />
          </Switch>
      </Router>
    );
  }
}
function Home() {
  return <h2>Home</h2>;
}

function About() {
  return <h2>About</h2>;
}

function Users() {
  return <h2>Users</h2>;
}
export default App;
